import React from "react";
import { Container, Typography, Box, Avatar, Paper } from "@mui/material";
import reactimage from "../assets/stack/React.png";
// import profileimage from "../assets/profileimage.jpeg";

export default function LeftPane() {
  return (
    <div style={{ backgroundColor: "white", maxWidth: 300, minWidth: 200 }}>
      <img
        src={reactimage}
        alt="React"
        style="width: 100%; height: auto; margin-top: 10px;"
      ></img>
    </div>
  );
}
